package fx.backend.domain;import jakarta.persistence.Entity;import jakarta.persistence.GeneratedValue;import jakarta.persistence.GenerationType;import jakarta.persistence.Id;import lombok.Data;@Data@Entitypublic class Orders {    @Id @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long ID;    private String name;    private Integer quantity;    private String phoneNumber;    private String bankName;    private OrderStatus status = OrderStatus.WAITING;    public Orders() {    }    public Orders(String name, Integer quantity, String phoneNumber, String bankName) {        this.name = name;        this.quantity = quantity;        this.phoneNumber = phoneNumber;        this.bankName = bankName;    }}